class Solution(object):
    def lengthOfLongestSubstring(self, s):
        """
        :type s: str
        :rtype: int
        """
        bak_letter = set()
        max_len = 0
        now_len = 0
        max_letter = len(set(s))
        for start in range(len(s)):
            now_len = 0
            #print(s[start:])
            if max_len == max_letter:
                break
            if max_len >= len(s[start:]):
                break
            for x in s[start:]:
                #print(x)
                if now_len == 0:
                    now_len += 1
                    bak_letter = set(x)
                else:
                    if x in bak_letter:
                        if now_len > max_len:
                            max_len = now_len
                        now_len = 1
                        bak_letter = set(x)
                    else:
                        #print('aaaaaaa')
                        now_len += 1
                        bak_letter.add(x)
            if now_len > max_len:
                max_len = now_len
        print(max_len)
        return max_len


